import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faPrescriptionBottle, faBroadcastTower, faCoffee, faDiagnoses, faDatabase } from '@fortawesome/fontawesome-free-solid'
import "./sidebar.css"
import { Button } from 'react-bootstrap';
import { Link } from 'react-router-dom';
const Sidebar = () => {
    return (
        <div>
         <FontAwesomeIcon icon={faDiagnoses} />  <Link path="/addDoctor" style={{borderStyle:"none", color:"none"}}>Add Doctor</Link> <br/><br/>
        <FontAwesomeIcon icon={faPrescriptionBottle} />  <Link style={{borderStyle:"none", color:"none"}}>Home</Link> <br/><br/>
        <FontAwesomeIcon icon={faDatabase} />  <Link style={{borderStyle:"none", color:"none"}}>Appointment</Link> 
        </div>
    );
};

export default Sidebar;
